import React from 'react';
import { Grid, Divider } from 'semantic-ui-react';
import '../App.css';


const RenderEmptyTable = (props) => {
  return (
    <Table.Row>
      <Table.Cell textAlign="left" width={3}> --- </Table.Cell>
      <Table.Cell textAlign="left" width={3}> --- </Table.Cell>
      <Table.Cell textAlign="left" width={4}> --- </Table.Cell>
      <Table.Cell textAlign="left" width={6}> --- </Table.Cell>
    </Table.Row>
  );
};

class Officers extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      activeContainer: 'Home'
    };
  };

  render() {
    return(
        <div/>
  )};
};

export default Officers;
